import React, { Component } from "react";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar from "./components/navbar";
import MainContent from "./components/maincontent";
function App() {
  return (
    <div className="App">
      <div class="container">
        <div class="row">

            <NavBar />

            <MainContent />

        </div>
      </div>
    </div>
  );
}

export default App;
